import { useEffect, useState } from "react";


function OTP3(){

    useEffect(()=>{
        fetch("http://localhost:3006/posts")
        .then((res)=>{
            return res.json()
        })
        .then((resp)=>{
            console.log(resp)
        })
    })
    
    return(
        <div style={{backgroundColor:"skyblue"}}>
            <h4>Mobile Number List</h4>
            <table>
                <th>
                    <tr>
                        <td>Email / phone Number</td>
                        <td>Action</td>
                    </tr>
                </th>
              
            </table>

        </div>
    )
}
export default OTP3;
